import React from 'react';
import { Link } from 'react-router-dom'
const NotFoundPage = () => {
    return (
      <div>
        <h1 style={{ color: "red", fontSize: 100 }}>404</h1>
        <h3>Page Not Found</h3>
        <p>
          <Link to="/"> Go Home</Link>
        </p>
      </div>
    );
  };
  
  export default App;
